import Keycloak from 'keycloak-js';
import { useEffect } from 'react';


const keycloak =()=>{
    useEffect(()=>{
        const intiKey= new Keycloak({
          url: 'http://localhost:8080/',
          realm: 'demo',
          clientId: 'demos'
        });
        intiKey();
    },[])
}

export default keycloak;
